import React from 'react';
import Select from 'react-select';
import CreatableSelect from 'react-select/creatable';
import { useSelector, useDispatch,connect } from 'react-redux';
import { useLocation, useHistory } from 'react-router';
import LoadingIndicator from '../common/LoadingIndicator';


class BulkDataInsert extends React.Component {
    constructor() {
        super();
        this.state={
            type_of_data_to_insert: 0,
            available_options: 0,
            bulk_data: "",
            bulk_loader:false
        }
    }
    onSelectDataType() {

    }
    render() {
        return (
            <section id="BulkDataInsert">
                <h4 className="mt-4 pt-5">
                    Bulk Data Insert
                </h4>
                <form id="bulkDataForm" name="bulkDataForm">
                <div className="my-2">
                    <div className="my-2">
                        Select Data want to insert:
                    </div>
                    <Select isLoading={this.state.bulk_loader} className="basic-single" classNamePrefix="select" id="type_of_data_to_insert" name="type_of_data_to_insert" options={props.all_options.asset_status_now_options} onChange={e => this.onSelectDataType(e, 'type_of_data_to_insert')} defaultValue={props.formikProps.values.asset_status_now} components={{LoadingIndicator}} styles={props.customStyles} />
                    <ErrorMessage name="asset_status_now" component="span" className="text-danger" />
                </div>
                </form>
            </section>
        )
    }
}
export default BulkDataInsert;
